import Button from '../Button';
import { Link } from 'react-router-dom';

export function ShowAdmins({ adminList }) {
  return (
    <div className=''>
      <table classNameName="table table-striped">
        <thead classNameNameName="">
          <tr>
            <th>Id</th>
            <th>Full Name</th>
            <th>Phone</th>
            <th>Email</th>
            <th>Password</th>
            <th>
              <Link to="/index/admins/new">
                <Button
                  color=""
                  bgColor="var(--primary-color)"
                  name="Add Admin"
                  id="addAdminBtn"
                  classNameName="btn px-4"
                />
              </Link>
            </th>
          </tr>
        </thead>
        <tbody id="tableDataField">
          {adminList.map((item) => {
            return (
              <tr>
                <td>{item.id}</td>
                <td>{item.fullName}</td>
                <td>{item.phone}</td>
                <td>{item.email}</td>
                <td>{item.password}</td>
                <td>
                  <Link to="/index/admins/edit">
                    <Button
                      color=""
                      bgColor=""
                      name="Edit"
                      id={item.id}
                      classNameName="btn editBtn"
                    />
                  </Link>

                  <Link to="/index/admins/delete">
                    <Button
                      color=""
                      bgColor=""
                      name="Delete"
                      id={item.id}
                      classNameName="btn deleteButton btn btn-customized text-center px-5"
                    />
                  </Link>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
import React from 'react'

export default function NewAdmin() {
  return (
    <div>NewAdmin</div>
  )
}

export function DeleteAdmin() {
  return <div>Admin Deleted</div>;
}

export function EditAdmin() {
  return <div>Edit Admin</div>;
}
